import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import { createUrl, log } from '../utils/utils';
const Admin = () => {
  const [carBookings, setCarBookings] = useState([]);
  const [customers, setCustomers] = useState([]);

 // const token = localStorage.getItem('token');


  useEffect(() => {
    fetchCarBookings();
    fetchCustomers();

  }, []);

  // Fetch functions (similar to previous code)

  const fetchCarBookings =  () => {
    const url = createUrl('/bookings')
        axios.get(url)
            .then(function (response) {
                setCarBookings(response.data);

                log(response);

            })
            .catch(function (error) {

                log(error);
            })
            .finally(function () {

            });
  };



  const fetchCustomers =  () => {
    const url = createUrl('/users')
        axios.get(url)
            .then(function (response) {
                setCustomers(response.data);

                log(response);

            })
            .catch(function (error) {

                log(error);
            })
            .finally(function () {

            });
  };




  const logout = () => {
    localStorage.removeItem('token');
    // Redirect or handle logout logic as needed

  };

  return (
    <div className="container mt-5">
      <h1 className="text-center mb-4">Admin Dashboard</h1>

      {/* Car Bookings */}
      <div className="card mb-3">
        <div className="card-body">
          <h5 className="card-title">Car Bookings</h5>
          <table className="table">
            <thead>
              <tr>
                <th>First Name</th>
                <th>Last Name</th>
                <th>Mobile</th>
                <th>Car Brand</th>
                <th>Car Model</th>
              </tr>
            </thead>
            <tbody>
              {carBookings.map((booking) => (
                <tr key={booking.id}>
                  <td>{booking.user.firstName}</td>
                  <td>{booking.user.lastName}</td>
                  <td>{booking.user.phone}</td>
                  <td>{booking.car.brandName}</td>
                  <td>{booking.car.modelName}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>



      {/* Customers */}
      <div className="card mb-3">
        <div className="card-body">
          <h5 className="card-title">Customers</h5>
          {customers.map((customer) => (
            <div key={customer.id}>
              <p>Name: {customer.name}</p>
              <p>Email: {customer.email}</p>
            </div>
          ))}
        </div>
      </div>


      <button className="btn btn-danger" onClick={logout}>
        Logout
      </button>
    </div>
  );
};

export default Admin;
